import React from "react";
import { useContext } from "react";
import CartContext from "../context/CartContext";


const Cart = () => {
    const {carrito} = useContext(CartContext);
    
    return (
        <>
        <h1>Mi Carrito</h1>
        <ul>
            {
                carrito.map(producto => <li>{producto.foto} {producto.titulo} Precio: ${producto.precio} Cantidad: {producto.cantidad}</li>)
            }

        </ul>
        </>
    )
}


export default Cart
